import React from "react";
import { webData } from "./data";
import Header from "./components/Header";
import Body from "./components/Body";
import { UserContext } from "./UserContext";

function Homepage() {
  return (
    <div>
      <UserContext.Provider>
        <Header />
        <Body />
      </UserContext.Provider>
    </div>
  );
}

export default Homepage;
